CREATE ALGORITHM=UNDEFINED DEFINER=`cilentwbeta6`@`%` SQL SECURITY DEFINER VIEW `st_view_cuisine`  AS SELECT `a`.`cuisine_id` AS `cuisine_id`, ifnull(`b`.`language`,'en') AS `language`, if((isnull(`b`.`cuisine_name`) or (`b`.`cuisine_name` = '')),`a`.`cuisine_name`,`b`.`cuisine_name`) AS `cuisine_name`, `a`.`status` AS `status`, `a`.`featured_image` AS `featured_image`, `a`.`slug` AS `slug`, `a`.`color_hex` AS `color_hex`, `a`.`font_color_hex` AS `font_color_hex` FROM (`st_cuisine` `a` left join `st_cuisine_translation` `b` on((`a`.`cuisine_id` = `b`.`cuisine_id`))) ;

