CREATE ALGORITHM=UNDEFINED DEFINER=`cilentwbeta6`@`%` SQL SECURITY DEFINER VIEW `st_view_item_relationship_subcategory`  AS SELECT `a`.`id` AS `id`, `a`.`merchant_id` AS `merchant_id`, `a`.`item_id` AS `item_id`, ifnull(`c`.`item_token`,'') AS `item_token`, `a`.`item_size_id` AS `item_size_id`, ifnull(`b`.`item_token`,'') AS `size_uuid`, `a`.`subcat_id` AS `subcat_id`, `a`.`multi_option` AS `multi_option`, `a`.`multi_option_value` AS `multi_option_value`, `a`.`require_addon` AS `require_addon`, `a`.`pre_selected` AS `pre_selected` FROM ((`st_item_relationship_subcategory` `a` left join `st_item_relationship_size` `b` on((`a`.`item_size_id` = `b`.`item_size_id`))) left join `st_item` `c` on((`a`.`item_id` = `c`.`item_id`))) WHERE (`a`.`item_size_id` > 0) ;

