CREATE ALGORITHM=UNDEFINED DEFINER=`cilentwbeta6`@`%` SQL SECURITY DEFINER VIEW `st_view_item_relationship_subcategory_item`  AS SELECT `b`.`merchant_id` AS `merchant_id`, `b`.`item_id` AS `item_id`, (select `st_item`.`item_token` from `st_item` where (`st_item`.`item_id` = `b`.`item_id`) limit 0,1) AS `item_token`, `b`.`item_size_id` AS `item_size_id`, `a`.`subcat_id` AS `subcat_id`, `a`.`sub_item_id` AS `sub_item_id` FROM (`st_subcategory_item_relationships` `a` left join `st_item_relationship_subcategory` `b` on((`a`.`subcat_id` = `b`.`subcat_id`))) WHERE (`b`.`merchant_id` is not null) ;

